            <h3>Nombre: { contacto.nombre }</h3>
            <h3>Apellido: { contacto.apellido }</h3>
            <h3>Email: { contacto.email }</h3>
            <h3>Est√° conectado: { contacto.estaConectado ? 'online' : 'offline' }</h3>
        </div>
    );
};


